This series was written by Daniel Way with art by Steve Dillon and others, and focuses on WOlverine's relationship with Daken among other plots as well as crossing into the Dark Reign storyline as well. Promotional info for the first collected edition - &quot;Picking up where House of M and Wolverine: Origins and Endings left off! Armed with the one thing that could kill him, as well as key clues to his very existence, Logan embarks on the first leg of a long and bloody quest for vengeance against those who once enslaved him. No longer feeling the need to play it quiet, Logan's first strike elicits a Condition Critical response from the U.S. government. With no other choice, they drop their bomb - and you won't believe who it is! When Logan hits D.C., someone's going to be waiting for him.&quot;

Summary from Comic Vine - &quot;For years Wolverine did not have access to his past memories due to brainwashing and memory implants. Now that he has regained those memories, he is attempting to sort them out. Faced with past deeds he was forced to complete, Wolverine is trying to right those wrongs and to seek out those responsible.&quot;

This is all 50 issues of the series + the 2007 annual. All of the regular issues are the new digital editions by AnPymGold in conjunction with Empire; the Annual has no digital copy and is the traditional scan by Steam-DCP. Thanks to all the scanners for their hard work; please seed, and enjoy! :-)
